{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/mikatekongobeni/cyclistic-business-case-scenario?scriptVersionId=96297058\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"c85f083d","metadata":{"_cell_guid":"a4c0be60-69c1-4b22-a755-f7ef3fab1278","_uuid":"495f3628-a490-4180-a863-580bc7993ecf","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.012174,"end_time":"2022-05-22T18:08:36.230743","exception":false,"start_time":"2022-05-22T18:08:36.218569","status":"completed"},"tags":[]},"source":["# Introduction to Cyclistic business case scenario\n","\n","## Case Study\n","\n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","## About Cyclistic\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","## Stakeholders and teams\n","\n","* **Lily Moreno**: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","* **Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","* **Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","## Director's business goal\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","## Business Task\n","\n","The marketing team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights the team will design a new marketing strategy to convert casual riders into annual members. Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualisations."]},{"cell_type":"markdown","id":"4d3564cf","metadata":{"papermill":{"duration":0.010278,"end_time":"2022-05-22T18:08:36.253137","exception":false,"start_time":"2022-05-22T18:08:36.242859","status":"completed"},"tags":[]},"source":["# Data source information\n","\n","Cyclistic's historical trip data will be used to analyze and identify trends. The data used for this business task was ethically sourced from and made available by Motivate International Inc. under this license https://www.divvybikes.com/data-license-agreement . All customer information is protected and kept private to prevent unethical use of data. The timeframe of the data collected is between May 2021 and April 2022. "]},{"cell_type":"markdown","id":"0de99a5f","metadata":{"papermill":{"duration":0.010477,"end_time":"2022-05-22T18:08:36.274024","exception":false,"start_time":"2022-05-22T18:08:36.263547","status":"completed"},"tags":[]},"source":["# Data cleaning and manipulation\n","\n","Data must be cleaned, manipulated and formated correctly to ensure a smooth analysis process. The below packages assist with data wrangling."]},{"cell_type":"code","execution_count":1,"id":"cc6a7bc8","metadata":{"execution":{"iopub.execute_input":"2022-05-22T18:08:36.300056Z","iopub.status.busy":"2022-05-22T18:08:36.297457Z","iopub.status.idle":"2022-05-22T18:11:10.841074Z","shell.execute_reply":"2022-05-22T18:11:10.837812Z"},"papermill":{"duration":154.559584,"end_time":"2022-05-22T18:11:10.843996","exception":false,"start_time":"2022-05-22T18:08:36.284412","status":"completed"},"t