hs associated with warmer weather conditions.\n","* Peak hours are between 3pm and 8pm for both members and casual users, with 5pm having the highest volume of users.\n"]},{"cell_type":"markdown","id":"1194ac62","metadata":{"papermill":{"duration":0.019137,"end_time":"2022-05-22T18:14:20.986098","exception":false,"start_time":"2022-05-22T18:14:20.966961","status":"completed"},"tags":[]},"source":["# Recommendations\n","\n","In order to convert casual users into full-time members, the following may need to be considered;\n","* Marketing campaigns would need to be targeted directly at casual users.\n","* Since casual users tend to ride longer distances, incentives - such as a rewards program can be introduced for using bikes for longer durations when becoming a full-time member. This may encourage casual users to be full-time members.\n","* The same could be said about using Cyclistic consistently throughout the year. This way, casual members would be encouraged to use bikes more regularly, and not limit use to warmer seasons.\n","* Casual users can also be encouraged to use the bikes to travel to work, this increases usage during weekdays. This can be done by promoting how using bikes over motor vehicles reduces carbon emmisions - making it safer for the environment - also tying it in with a type of rewards program for full-time members.\n"]},{"cell_type":"markdown","id":"22e9a737","metadata":{"papermill":{"duration":0.02129,"end_time":"2022-05-22T18:14:21.028316","exception":false,"start_time":"2022-05-22T18:14:21.007026","status":"completed"},"tags":[]},"source":["# Thanks for reading!"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":348.971499,"end_time":"2022-05-22T18:14:21.371956","environment_variables":{},"exception":null,"input_path":"__notebook_